import Leaf from 'leaflet';
import React from 'react';
import 'leaflet/dist/leaflet.css';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';

// Custom icon for markers
const customIcon = new Leaf.Icon({
  // iconUrl:  "https://freepngimg.com/thumb/car/75694-bird's-eye-car-top-view,plan-view-icon.png",
  iconUrl:require('./car.png'),
  iconSize: [35, 35],
  iconAnchor: [12, 41],
  popupAnchor: [1, -34],
  tooltipAnchor: [16, -28],
});

const markers = [
  {
    geocode: [58.86, 90.3522],
    popUp: "Hello, I am pop up 1"
  },
  {
    geocode: [58.85, 50.3522],
    popUp: "Hello, I am pop up 2"
  },
  {
    geocode: [48.855, 2.34],
    popUp: "Hello, I am pop up 3"
  }
];


const Google = () => {
  return (
    <MapContainer center={[41.313723, 69.282787]} zoom={10} style={{ height: '100vh', width: '100%' }}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
      />

         {markers.map((marker) => (
          <Marker position={marker.geocode} icon={customIcon}>
            <Popup>{marker.popUp}</Popup>
          </Marker>
          ))}

      {/* <Marker position={[41.313723, 69.282787]} icon={customIcon}>
        <Popup>
            here will be my ballon.
        </Popup>
      </Marker> */}
    </MapContainer>
  );
};

export default Google;
